import sys


class Board:
    def __init__(self, size):
        self.size = size

    def is_valid(self, x, y):
        return 0 <= x < self.size and 0 <= y < self.size

    def is_valid_pos(self, pos):
        return self.is_valid(*pos)

    def get_distance(self, pos1, pos2):
        return abs(pos1[0] - pos2[0]) + abs(pos1[1] - pos2[1])

    def get_neighbours(self, pos):
        neighbours = []
        x, y = pos
        for dx, dy in (1, 1), (1, -1), (-1, 1), (-1, -1):
            neighbours.append((x + dx, y + dy))
        return neighbours

    def get_neighbours_excl(self, pos):
        neighbours = set()
        x, y = pos
        for dx, dy in (1, 1), (1, -1), (-1, 1), (-1, -1):
            neighbours.add((x + dx, y + dy))
        return neighbours

    def get_valid_neighbours(self, pos):
        return [pos for pos in self.get_neighbours(pos) if self.is_valid_pos(pos)]

    def get_valid_neighbours_excl(self, pos):
        return [pos for pos in self.get_neighbours_excl(pos) if self.is_valid_pos(pos)]

    def print(self, l):
        for i in range(self.size):
            print(l[i])


