    def replace(self, target: tuple):
        self.visited.add(target)
        return self.visited

    def can_move(self, pos):
        return pos not in self.visited

    def is_target(self, pos):
        return pos in self.targets


class Rook(Knight):
    def __init__(self, board: Board, pos: tuple):
        super().__init__(board, pos)
