            return min(self.graph[v])
        return v

    def get_b(self, v):
        if v in self.graph:
            return max(self.graph[v])
        return v

    def dominoes(self):
        # dp[i][j] = number of dominoes with a_i <= a_j <= b_i <= b_j <= i + j
        dp = [[0] * (self.n+1) for _ in range(self.n+1)]
        dp[0][0] = 1
        for _ in range(1, self.n):
