                b_i = self.b[i+1]
                for j in range(self.n):
                    a_j = self.a[j+1]
                    b_j = self.b[j+1]
                    if a_i <= a_j <= b_i <= b_j:
                        dp[i+1][j+1] += dp[i][j]
                    dp[i+1][j+1] %= 10000007
        return dp[-1][-1]


