from typing import List


class Solution:
    def solution(self, array: List[int], number: int) -> int:
        def count(number: int) -> int:
            res = 0
            while number:
                res += number & 1
                number >>= 1
            return res

        def get_equal_part(array: List[int], number: int) -> List[int]:
            equal_part = []
            for i in range(len(array) - 1):
                if array[i] == array[i + 1]:
                    equal_part.append(i)
            equal_part.append(len(array) - 1)
            return equal_part

        def binary_search(array: List[int], number: int) -> int:
            left = 0
            right = len(array) - 1
            while left < right:
                mid = (left + right) // 2
                if array[mid] == number:
                    return mid
                elif array[mid] < number:
                    left = mid + 1
                elif array[mid] > number:
                    right = mid - 1
            return -1

        if len(array) < 2:
            return -1
        equal_part = get_equal_part(array, number)
        if len(equal_part) < 2:
            return -1
        for i in equal_part:
            index = binary_search(array, number ^ array[i])
            if index == -1:
                return -1
            array[index] = number
        return count(number)

