class MaxEating(object):
    def __init__(self, rows, cols):
        self.cake = []
        self.rows = rows
        self.cols = cols
        self.max_eating = 0
        for _ in range(rows):
            self.cake.append(list(stdin.readline().strip()))

    def _bfs(self, rows, cols):
        # Enqueue all the rotten strawberry in the cake
        q = deque()
        for i in range(rows):
            for j in range(cols):
                if self.cake[i][j] == 'S':
                    q.append((i, j))

        # BFS the cake
        while q:
            # Dequeue all the rotten strawberry
            row, col = q.popleft()

            # Search for adjacent cell that has not been visited
            for dr, dc in [(0, -1), (0, 1), (-1, 0), (1, 0)]:
                r, c = row + dr, col + dc
                if 0 <= r < rows and 0 <= c < cols:
                    # Check if the cell is a cake cell
                    if self.cake[r][c] == '.':
                        # Mark the cell as visited
                        self.cake[r][c] = 'V'
                        # Enqueue the cell
                        q.append((r, c))

        # Print the number of eating
        return sum(row.count('V') for row in self.cake)

    def eat(self):
        # Eat the maximum number of cake cells
        self.max_eating = max(self.max_eating, self._bfs(self.rows, self.cols))

