The solution is simple, the girls can exchange their chizhiks in such a way that they will buy the maximum possible number of coconuts. It is obvious that the solution works if the girls have more money than the price of a single coconut. Therefore, we start by checking whether the girls have more money than the price of a single coconut.

Our initial chizhiks have $5+4=9$ each, and the price of a single coconut is $3$. If the sum is greater than the price, the girls can buy an integer number of coconuts. Otherwise the girls will have to pay for the amount of chizhiks and some amount of coconuts.

Then we start thinking of exchanging with chizhiks. The girls have $5$ chizhiks and they can exchange with only one chizhik. Therefore, we can try to exchange with $4$ chizhik. We will be able to get an integer number of coconuts. In the first example we have $1 + 4 = 5$ coconuts, in the second example we have $6 + 0 = 6$ coconuts. 

If we want to be able to buy the maximum number of coconuts we can exchange with $4$ chizhik. The girls have $5-4 = 1$ chizhik, and the number of coconuts they will buy is $3 + 1 = 4$.

The minimum number of chizhiks we need to exchange with Masha is 0, because we can buy all coconuts.

