class Solution:
    def count(self, m: int, n: int, k: int) -> int:
        """
        Time Complexity: O(m * n)
        Space Complexity: O(1)
        """

        @cache
        def f(m: int, n: int, k: int) -> int:
            if m == 0:
                return 0
            if m == 1:
                return 1
            if n == 0:
                return 0
            if n == 1:
                return 1
            if k == 0:
                return 1
            return (
                f(m - 1, n, k - 1)
                + f(m, n - 1, k - 1)
                + f(m - 1, n - 1, k - 1)
            ) % (10 ** 9 + 7)

        return f(m, n, k)

