class Solution:
    """The solution to the leetcode problem 923."""

    @require(lambda lines: len(lines) == 3)
    @require(lambda lines: all(len(line) == 3 for line in lines))
    @require(lambda lines: all(all(0 <= int(number) <= 100 for number in line) for line in lines))
    def solve(self, lines: List[str]) -> None:
        """Solve leetcode problem 923."""
        grid = self.parse_grid(lines)
        self.solve_grid(grid)

    def parse_grid(self, lines: List[str]) -> Grid:
        """Parse the input lines into a grid."""
        return Grid(
            [
                [
                    Light()
                    if int(number) == 0 else
                    Light() if int(number) == 1 else
                    Light()
                ] * 3
                for line in lines
                for number in line
            ]
        )

    def solve_grid(self, grid: Grid) -> None:
