from typing import Callable, List, Union
from collections import Counter


class Solution:
    def __init__(self, stdin: str):
        self.n, self.k = map(int, stdin.split())
        self.requirements = []
        for _ in range(self.k):
            self.requirements.append(self.parse_input(stdin))

    @staticmethod
    def parse_input(stdin: str) -> List[Union[int, int, str]]:
        x, sign, y = stdin.split()
        return [int(x), int(y), sign]

    def parse_requirements(self) -> List[List[int]]:
        return list(map(lambda req: [req[0], req[2] - 1, req[1]], self.requirements))

    def parse_solution(self, solution: List[int]) -> bool:
        x_first, x_last, y_first, y_last = solution[0], solution[-1], solution[1], solution[-2]
        requirements = self.parse_requirements()
        first_requirement = requirements[0]
        requirements_satisfied = True
        for requirement in requirements[1:]:
            requirement_satisfied = True
            requirement_x = requirement[0]
            if requirement[2] == '<':
                requirement_satisfied = x_first <= requirement_x
            elif requirement[2] == '>':
                requirement_satisfied = x_first > requirement_x
            elif requirement[2] == '<=':
                requirement_satisfied = x_first <= requirement_x <= x_last
            elif requirement[2] == '>=':
                requirement_satisfied = x_first >= requirement_x >= x_last
            if not requirement_satisfied:
                requirements_satisfied = False
                break
        if requirements_satisfied:
            if y_first < y_last:
                return True
        return False

    def solve(self) -> str:
        """
        Returns the number of ways to arrange the blocks
        such that requirements about the shape of the mausoleum
        and k additional requirements are met.
        """
        counter = Counter(map(str, range(2 * self.n)))
        solution_count = 0
        for key in counter:
            solution = [int(x) for x in key.split()]
            if self.parse_solution(solution):
                solution_count += int(counter[key])
        return str(solution_count)

