        x, y = self.root(i), self.root(j)
        if x == y:
            return

        if self.rank[x] < self.rank[y]:
            x, y = y, x
        if self.rank[x] == self.rank[y]:
            self.rank[x] += 1
        self.size[y] += self.size[x]
        self.parent[x] = y
        self.size[x] = 0

    def same(self, i, j):
        return self.root(i) == self.root(j)

    def count(self, i):
        return self.size[self.root(i)]

