class Solution:
    def __init__(self, n: int, m: int, p: List[int], pairs: List[List[int]]):
        self.n = n
        self.m = m
        self.p = p
        self.pairs = pairs
        self.mapping: Dict[int, int] = {p[i]: i + 1 for i in range(n)}
        self.p_indices: Dict[int, int] = {v: k for k, v in self.mapping.items()}
        self.rev_mapping: Dict[int, int] = {i + 1: p[i] for i in range(n)}
        self.rev_p_indices: Dict[int, int] = {v: k for k, v in self.rev_mapping.items()}

