        return self.rev_p_indices

    def get_mapping(self) -> Dict[int, int]:
        return self.mapping

    def get_p_indices(self) -> Dict[int, int]:
        return self.p_indices

    def swap(self, x: int, y: int) -> Dict[int, int]:
        if x == y:
            return self.mapping
        i, j = self.p_indices[x], self.p_indices[y]
        self.rev_mapping[i], self.rev_mapping[j] = self.rev_mapping[j], self.rev_mapping[i]
        self.rev_p_indices[i], self.rev_p_indices[j] = self.rev_p_indices[j], self.rev_p_indices[i]
        self.mapping[i], self.mapping[j] = self.mapping[j], self.mapping[i]
        self.p_indices[i], self.p_indices[j] = self.p_indices[j], self.p_indices[i]
        return self.mapping

    def solve(self) -> Dict[int, int]:
        for a, b in self.pairs:
            self.swap(a, b)
        return self.mapping

