import sys

class Solution:
    def solution(self, input: str) -> str:
        N, K = map(int, input.split())
        A = list(map(int, input.split()))
        maximum = 0
        for X in range(K):
            XOR = 0
            for Ai in A:
                XOR ^= Ai
            if XOR > maximum:
                maximum = XOR
        return str(maximum)

