import sys
import collections

class Solution:
    def solve(self, stdin):
        n, t, k = [int(x) for x in stdin.readline().split()]
        a = [int(x) for x in stdin.readline().split()]
        if sum(a) - 1!= n - 1:
            return "-"
        count = collections.Counter(a)
        if sum(count.values()) < n - 1:
            return "-1"
        routes = list(range(2, n))
        for i in range(1, n):
            if count[i] == 1:
                routes = [1] + routes
        routes = set(routes)
        if len(routes)!= k:
            return "-1"
        return len(routes)
